def login(driver):
    driver.get("https://www.codewars.com/users/sign_in")
    driver.implicitly_wait(0.5)
    email = driver.find_element(By.ID, "user_email")
    password = driver.find_element(By.ID, "user_password")

    email.send_keys(EMAIL)
    password.send_keys(PASSWORD)
    password.send_keys(Keys.RETURN)

    driver.implicitly_wait(TIMEOUT)

def get_list_of_questions(driver):
    url = "https://www.codewars.com/kata/search/python?q=&r[]=-8&beta=false&order_by=popularity%20desc"
    driver.get(url)
    driver.implicitly_wait(TIMEOUT)

    
    last_height = driver.execute_script("return document.body.scrollHeight")
    while True:

        driver.execute_script("window.scrollTo(0, document.body.scrollHeight);")

        # Wait to load page
        time.sleep(SCROLL_PAUSE_TIME)
        

        # Calculate new scroll height and compare with last scroll height
        new_height = driver.execute_script("return document.body.scrollHeight")
        if new_height == last_height:
            break
        last_height = new_height

        

    titles = driver.find_elements(By.CLASS_NAME, 'item-title')
    ids = [t.find_element(By.TAG_NAME, 'a').get_attribute('href')[-24:] for t in titles]

    url = "https://www.codewars.com/kata/search/python?q=&r[]=-7&beta=false&order_by=popularity%20desc"

    driver.get(url)
    driver.implicitly_wait(TIMEOUT)

    
    last_height = driver.execute_script("return document.body.scrollHeight")
    while True:

        driver.execute_script("window.scrollTo(0, document.body.scrollHeight);")

        # Wait to load page
        time.sleep(SCROLL_PAUSE_TIME)
        

        # Calculate new scroll height and compare with last scroll height
        new_height = driver.execute_script("return document.body.scrollHeight")
        if new_height == last_height:
            break
        last_height = new_height

    titles = driver.find_elements(By.CLASS_NAME, 'item-title')
    ids2 = [t.find_element(By.TAG_NAME, 'a').get_attribute('href')[-24:] for t in titles]
    
    return ids + ids2

def get_solutions(driver, id):
    url = f"https://www.codewars.com/kata/{id}/solutions/python"
    driver.get(url)

    driver.implicitly_wait(TIMEOUT)
    try:
        unlock = driver.find_element(By.CLASS_NAME, 'js-unlock-solutions')
        unlock.click()
        time.sleep(5)
    except:
        pass

    # if unlock already clicked, and solution available.
    try:
        tmp = driver.find_element(By.CSS_SELECTOR, 'code[data-language="python"]')
    except:
        return None, None


    good, bad = [], []
    # Get scroll height
    last_height = driver.execute_script("return document.body.scrollHeight")
    count = 0
    while count < 3:
        # Scroll down to bottom
        

        driver.execute_script("window.scrollTo(0, document.body.scrollHeight);")

        # Wait to load page
        time.sleep(SCROLL_PAUSE_TIME)
        

        # Calculate new scroll height and compare with last scroll height
        new_height = driver.execute_script("return document.body.scrollHeight")
        
        last_height = new_height

        count += 1

    codes = driver.find_elements(By.CSS_SELECTOR, 'code[data-language="python"]')
    code_arr = [code for code in codes if code.text]
    votes = driver.find_elements(By.CSS_SELECTOR, '[data-label="best_practice"]')
    vote_arr = [vote.find_element(By.TAG_NAME, 'span') for vote in votes if vote.text]
    for c, v in zip(code_arr, vote_arr):
        if int(v.text) > 3:
            good.append(c.text)
        else:
            bad.append(c.text)    
    return good, bad

def get_question(id):
    r = requests.get(f"https://www.codewars.com/api/v1/code-challenges/{id}")
    q = r.json()
    question = {'name': q['name'], 'category':q['category'], 'description': q['description']}
    return question

def job(id):
    service = Service(executable_path=PATH)
    driver = webdriver.Chrome(service=service)
    login(driver)
    
    try:
        q = get_question(id)
    except:
        return
    good, bad = get_solutions(driver, id)
    if not good and not bad:
        return
    q['good'] = good
    q['bad'] = bad
    RES.append(q)
    driver.quit()
    return

if __name__ == '__main__':
   
    threads = []
    pool = concurrent.futures.ThreadPoolExecutor(max_workers=3)

    for id in IDS:
        
        pool.submit(job, id)

    pool.shutdown(wait=True)
    

    with open("codewars.json", "w") as outfile:
        json.dump(RES, outfile)
